import React, { useState } from "react";
import { Link } from "react-router-dom";

const Navbar = () => {
  const [isOpen, setIsOpen] = useState(false);

  return (
    <nav className="bg-white shadow-md fixed top-0 left-0 w-full z-50">
      <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
        <div className="flex justify-between items-center py-4">
          {/* Logo */}
          <Link to="/" className="text-2xl font-bold text-yellow-600">Astrology Hub</Link>

          {/* Desktop Menu */}
          <ul className="hidden md:flex space-x-6 text-gray-700 font-medium">
            <li><Link to="/" className="hover:text-yellow-600 transition duration-300">Home</Link></li>
            <li><Link to="/horoscope" className="hover:text-yellow-600 transition duration-300">Horoscope</Link></li>
            <li><Link to="/consult" className="hover:text-yellow-600 transition duration-300">Consult</Link></li>
            <li><Link to="/tarot-card" className="hover:text-yellow-600 transition duration-300">Tarot Card</Link></li>
            <li><Link to="/e-pooja" className="hover:text-yellow-600 transition duration-300">E-Pooja</Link></li>
            <li><Link to="/gem-store" className="hover:text-yellow-600 transition duration-300">Gem Store</Link></li>
          </ul>

          {/* Mobile Menu Button */}
          <button onClick={() => setIsOpen(!isOpen)} className="md:hidden text-gray-700 focus:outline-none">
            {isOpen ? "✖" : "☰"}
          </button>
        </div>

        {/* Mobile Menu */}
        {isOpen && (
          <ul className="md:hidden flex flex-col items-center bg-white shadow-md py-4 space-y-4">
            <li><Link to="/" className="hover:text-yellow-600 transition duration-300" onClick={() => setIsOpen(false)}>Home</Link></li>
            <li><Link to="/horoscope" className="hover:text-yellow-600 transition duration-300" onClick={() => setIsOpen(false)}>Horoscope</Link></li>
            <li><Link to="/consult" className="hover:text-yellow-600 transition duration-300" onClick={() => setIsOpen(false)}>Consult</Link></li>
            <li><Link to="/tarot-card" className="hover:text-yellow-600 transition duration-300" onClick={() => setIsOpen(false)}>Tarot Card</Link></li>
            <li><Link to="/e-pooja" className="hover:text-yellow-600 transition duration-300" onClick={() => setIsOpen(false)}>E-Pooja</Link></li>
            <li><Link to="/gem-store" className="hover:text-yellow-600 transition duration-300" onClick={() => setIsOpen(false)}>Gem Store</Link></li>
          </ul>
        )}
      </div>
    </nav>
  );
};

export default Navbar;
